import React, { useEffect, useState } from "react";
import axios from "axios";
import TopBar from "../components/TopBar";
import Footer from "../components/Footer";
import { useAuth } from "../context/AuthContext";
import moment from "moment";

function ClientCheckout() {
  const { user } = useAuth();
  const [orgs, setOrgs] = useState([]);
  const [selectedOrg, setSelectedOrg] = useState("");
  const [reservations, setReservations] = useState([]);
  const [notes, setNotes] = useState({});
  const [loading, setLoading] = useState(false);
  const [feedback, setFeedback] = useState("");
  const [scanMode, setScanMode] = useState(true);
  const [tableBarcode, setTableBarcode] = useState("");

  useEffect(() => {
    const fetchOrgs = async () => {
      const res = await axios.get("/api/organizations/active");
      setOrgs(res.data);
    };
    fetchOrgs();
  }, []);

  const fetchReservationByTable = async () => {
    try {
      const res = await axios.get(`/api/organizations/by-table/${tableBarcode}`);
      setSelectedOrg(res.data.name);
      setReservations(res.data.reservations);
      setScanMode(false);
    } catch {
      setFeedback("❌ Table not associated with an active reservation.");
    }
  };

  const handleOrgChange = async (orgName) => {
    setSelectedOrg(orgName);
    const res = await axios.get(`/api/organizations/${orgName}`);
    setReservations(res.data.reservations);
    setScanMode(false);
  };

  const handleCheckout = async (resv, index) => {
    const note = notes[index] || "N/A";
    try {
      // Log checkout
      await axios.post("/api/organizations/checkout", {
        organization: selectedOrg,
        reservationIndex: index,
        notes: note,
        checkOutTime: new Date().toISOString(),
      });

      // Check in all associated items
      const barcodes = [];
      if (resv.table?.barcode) barcodes.push(resv.table.barcode);
      if (resv.chairs?.length) {
        barcodes.push(...resv.chairs.map(c => c.barcode));
      }

      for (const barcode of barcodes) {
        await axios.post("/api/items/check-in", {
          barcode,
          username: user.username,
        });
      }

      setFeedback("✅ Checkout successful.");
    } catch (err) {
      setFeedback("❌ Failed to check out. Try again.");
    }
  };

  return (
    <>
      <TopBar />
      <div className="min-h-screen bg-gray-900 text-white p-6">
        <h2 className="text-3xl font-bold text-asuGold mb-6 text-center">Client Check-Out</h2>

        {scanMode ? (
          <div className="max-w-md mx-auto text-center">
            <p className="mb-4">Scan the table barcode or select the organization</p>
            <input
              type="text"
              placeholder="Table Barcode"
              value={tableBarcode}
              onChange={(e) => setTableBarcode(e.target.value)}
              className="p-2 rounded bg-gray-800 w-full mb-4"
            />
            <button
              onClick={fetchReservationByTable}
              className="bg-asuGold text-black px-4 py-2 rounded mb-6"
            >
              Scan
            </button>

            <p className="mt-4 mb-2">Or select organization</p>
            <select
              value={selectedOrg}
              onChange={(e) => handleOrgChange(e.target.value)}
              className="bg-gray-800 p-2 w-full rounded"
            >
              <option value="">-- Select --</option>
              {orgs.map((org) => (
                <option key={org._id} value={org.name}>{org.name}</option>
              ))}
            </select>
          </div>
        ) : (
          <div className="max-w-3xl mx-auto">
            <h3 className="text-2xl font-semibold mb-4 text-center">Reservations for {selectedOrg}</h3>
            {reservations.map((resv, i) => (
              <div key={i} className="bg-gray-800 p-4 rounded mb-4">
                <p><strong>Client:</strong> {resv.clientName}</p>
                <p><strong>Spot:</strong> {resv.tablingSpot}</p>
                <p><strong>Event #:</strong> {resv.eventNumber}</p>
                <p><strong>Checked In:</strong> {moment(resv.checkInTime).format("MMM D, h:mm A")}</p>
                <textarea
                  placeholder="Notes (optional)"
                  value={notes[i] || ""}
                  onChange={(e) => setNotes({ ...notes, [i]: e.target.value })}
                  className="w-full mt-2 p-2 bg-gray-700 rounded"
                />
                <button
                  onClick={() => handleCheckout(resv, i)}
                  className="bg-green-600 px-4 py-2 mt-3 rounded text-white"
                >
                  Check Out
                </button>
              </div>
            ))}
          </div>
        )}

        {feedback && (
          <div className="mt-6 text-center font-semibold text-yellow-400">
            {feedback}
          </div>
        )}
      </div>
      <Footer />
    </>
  );
}

export default ClientCheckout;
